import React from 'react';
import styled from 'styled-components';

const StyledSlideSix = styled.div`
  position: relative;
  background: #FFFFFF;
  height: 100vh;
  width: 100vw;

  #yellow-block {
    height: 80vh;
    width: 40vw;
  }
`;

function SlideSix() {
  return (
    <StyledSlideSix className="slide-six">
      <div id='yellow-block'>

      </div>
    </StyledSlideSix>
  );
}

export default SlideSix;
